description:
 1. Roupeiro 100% em MDF.
2. Revestido por pintura de alto relevo com 7 camadas de tinta; conferindo beleza, durabilidade e resistência.
3.Sistema de fixação com minifix que facilita a montagem permitindo ainda que o móvel seja desmontado e montado varias vezes sem danifica-lo, muito conveniente em caso de mudanças;
4.Puxadores e trilhos em alumínio na cor champanhe embelezam e não enferrujam mesmo em regiões litorâneas sob o efeito da maresia;
5. Avançado sistema de rodízios de portas de correr que evita o descarrilamento e proporciona um deslizamento suave e silencioso;
6.Opção de ?portas de espelho?, elegância e praticidade. 
7.Ampla divisão interna com muitas prateleiras, cabideiros para roupas longas e curtas, e calceiros garantem máxima funcionalidade e aproveitamento;
8.Corrediças telescópicas com limitador de saída permitem abertura total da gaveta sem risco de escape oferecendo maior aproveitamento com total segurança;
9.Colmeia porta objetos/jóias e chave na primeira gaveta, sofisticação e segurança;
10.Frentes de gaveta com design moderno, facilitam a abertura proporcionando um elegante visual interno.
11.Cabideiros e calceiros em alumínio estriado e formato oblongo suportam maior peso e não enferrujam;
12.Porta cintos/gravatas metalizado, maior aproveitamento e praticidade.
 13. Opção de kits de pés e prateleiras, para uma maior otimização e adaptibilidade.
14.Perfis alinhadores de alumínio nas portas, dando maior resistência contra empenamentos.
15. Roupeiro com cor amadeirada e portas brancas, conferindo um design inovador para seu quarto.

